import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

export default new Vuex.Store({
  state: {
    generatedUser: null
  },
  mutations: {
    setGeneratedUser(state, user) {
      state.generatedUser = user
    }
  }
})
